import React from 'react'
import { useFeed } from './util/hooks'

const Feed = () => {
  const { feed } = useFeed()

  console.log(feed)

  return feed ? (
    <>
      {feed.map((item, i) => {
        <ul>
          <li>
            <p>test</p>
          </li>
        </ul>
      })}
    </>
  ) : null
}

export default Feed
